export class Topic {

  name: string;
  courseId: number;
  content: File | null;

  constructor(
    topicName: string,
    courseId: number,
    content: File | null
  ) {
    this.topicName = topicName;
    this.courseId = courseId;
    this.topicContent = topicContent;
  }
}
